import React from "react";
import styles from "../styles/mainStyles.module.scss";

function Hero() {
  return (
    <div>
      <img
        src="https://s3.eu-central-1.amazonaws.com/festivall-bucket/festivals/hero_images/000/003/425/large_webp_2x/d2a2efc11d9753a8556e8e2f13086068.webp?1582570920"
        alt=""
      />
      <h3>DEVELOPING. CREATING. DREAMING.</h3>
      <h1>Made for artists.</h1>
      <Row className={styles.rowHeader}>
        <Col lg={6} xs={11} className={styles.columnHeader}>
          <h2>
            Loved by creative professionals, Procreate has everything you need
            to create expressive sketches, rich paintings, gorgeous
            illustrations and beautiful animations. Procreate is the complete
            art studio you can take anywhere, packed with unique features and
            intuitive creative tools.
          </h2>
        </Col>
      </Row>
    </div>
  );
}

export default Hero;
